    // Handle sun control effects
    async handleSunControl(effect) {
        const { action, parameters = {} } = effect;
        const amount = parameters.amount || 100;
        if (action === 'add_sun') {
            return await this.addSun(amount, effect.username);
        }
        else if (action === 'subtract_sun') {
            return await this.subtractSun(amount, effect.username);
        }
        return false;
    }
    // Handle mower control effects
    async handleMowerControl(effect) {
        const { action, parameters = {} } = effect;
        const row = parameters.row;
        if (action === 'start_mower') {
            if (row !== undefined && typeof row === 'number') {
                return await this.startMower(row, effect.username);
            }
            else {
                return await this.startAllMowers(effect.username);
            }
        }
        else if (action === 'delete_mower') {
            if (row !== undefined && typeof row === 'number') {
                return await this.deleteMower(row, effect.username);
            }
            else {
                return await this.deleteAllMowers(effect.username);
            }
        }
        return false;
    }
    // Handle clear effects
    async handleClearEffect(effect) {
        const { action } = effect;
        if (action === 'clear_all_plants') {
            return await this.clearAllPlants(effect.username);
        }
        else if (action === 'clear_all_zombies') {
            return await this.clearAllZombies(effect.username);
        }
        else if (action === 'clear_everything') {
            await this.clearAllPlants(effect.username);
            await this.clearAllZombies(effect.username);
            return true;
        }
        return false;
    }
